import React from "react";
import { FaTrashAlt } from "react-icons/fa";


const Itemlist = ({ handleChange, handleDelete, item }) => {
  return (
    <ul>
      {item.map((objectData) => (
        <li className="item" key={objectData.id}>
          <input
            type="checkbox"
            checked={objectData.checked}
            onChange={() => handleChange(objectData.id)}
          />
          <label
            style={
              objectData.checked ? { textDecoration: "line-through" } : null
            }
            onDoubleClick={() => handleChange(objectData.id)}
          >
            {objectData.content}
          </label>
          <button onClick={() => handleDelete(objectData.id)}>
            <FaTrashAlt role="button" tabIndex="0" />
          </button>
        </li>
      ))}
    </ul>
  );
};
export default Itemlist;
